import React from 'react';
import './App.css';
import Cliente from '../src/Components/Cliente'
import Vendedor from './Components/vendedor';

function App() {
  return (
    <div className = 'container'>
      <div className = 'row'>
        <div className = 'col-6'>
          <Cliente/>
          <Vendedor/>
        </div>
      </div>
    </div>
  );
}

export default App;
